export const styles = {
  appBar: {
    backgroundColor: "#4580bf",
    align: "right",
    height: "50px",
    '& .MuiToolbar-regular': {
      minHeight: "50px"
    }
  },
  name: {
    color: "#dbdbdb",
  },
  link: {
    textTransform: "unset",
    color: "#dbdbdb",
    margin: "0 20px",
    textDecoration: "unset",

    "&:hover": {
     color: "#f1f1f1",
    }
  },
  logo: {
    textTransform: "unset",
    color: "#dbdbdb",
    margin: "0 20px",
    textDecoration: "unset",
  },
  rightToolbar: {
    marginLeft: "auto",
    marginRight: 10
  },
  paper: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(1),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
}
